offer.description:
В современном мире здоровое питание - залог успеха. Ланч-боксы от Monbento сохраняют полезные свойства продуктов, герметичны и изготовлены из безопасного пищевого пластика. В составе контейнера отсутствует опасный для здоровья компонент BPA (бисфенол – а).

MB Square - это два контейнера, которые позволяют взять с собой сразу несколько блюд для полноценного обеда. Большой объем ланч-бокса идеален для транспортировки больших салатов, сэндвичей, полугустых соусов. Не рекомендован для перевозки жидкостей. 

Надежность, компактность и стиль в одном комплекте!
- общий объем - 1,7 литра;
- можно греть в микроволновой печи и мыть в посудомоечной машине;
- под крышку легко помещаются специальные столовые приборы от Monbento (продаются отдельно).

